  false,\n\t\"url\": null,\n\t\"notes\": \"Counts of primarily planktonic foraminifera
  from Dr. W.F. Ruddiman and staff at the Lamont-Doherty Earth Observatory of Columbia
  University are included in these files. Some diatom observations made by Dr. C.
  Sancetta of LDEO are also included. The data set consists of approximately 35 files
  of faunal counts including core id., latitude, longitude, water depth, and appropriate
  transfer function. Data also include depth in core, count of total species, total
  abundance, case condition for count, core type code, and faunal code. A taxonomic
  overview is included, along with complete documentation. Associated Sea Surface
  temperature estimates are also included. These data were originally submitted to
  NOAA's National Geophysical Data Center (NGDC) for archive and subsequently transferred
  to NOAA's National Climatic Data Center (NCDC) Paleoclimatology Group for stewardship.
  These data are available for direct download from NCDC.\",\n\t\"license_title\":
